import './Header.css';
const Header = () => {
  return (
    <header className="Container">
        <nav className='Navbar'>
            <ul>
                <a href="#"><li>About Us</li></a>
                <a href="#"><li>Contact Us</li></a>
                <a href="#"><li>Services</li></a>
                <a href="#"><li>Payment</li></a>
                <a href="#"><li>Book</li></a>
            </ul>
        </nav>
        <img className='item'></img>
    </header>
  )
}

export default Header;
